import React from 'react';
import Login from './Login';
import AdminDashboard from './AdminDashboard';
import UserDashboard from './UserDashboard';
import Routes from './Routes'; // Importar el nuevo componente Routes

function App() {
  const isAuthenticated = true; // Cambiar esto a la lógica de autenticación real
  const isAdmin = true; // Cambiar esto a la lógica de autenticación real

  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to My Auth App</h1>
        <nav>
          <button onClick={() => window.open('/login', '_self')}>Login</button>
          <button onClick={() => window.open('/routes', '_self')}>Routes</button>
        </nav>
      </header>
      {!isAuthenticated ? (
        <Login />
      ) : isAdmin ? (
        <AdminDashboard />
      ) : (
        <UserDashboard />
      )}
    </div>
  );
}

export default App;
